import { NavLink } from 'react-router-dom';
import LikedIcon from '../../../Icons/LikedIcon';
import UnlikedIcon from '../../../Icons/UnlikedIcon';
export default class SongListBlock extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  changePage = (page) => {

  }
  render() {
    const lists = this.props.list;
    console.log(lists)
    return (
      <div className="SideBar-unit">
        <div className="title">创建的歌单</div>
        <ul>
          {lists.map((l, idx) => {
            return (
              <li>
                <div className='icon'>{idx == 0? <UnlikedIcon /> : <></>}</div>
                <NavLink className="list-item" key={idx} to={l.path}>{l.listName}</NavLink>
              </li>
            )
          }
          )}
        </ul>

      </div>

    );
  }
}
